import React,{useState,useEffect} from 'react';
import './App.css';
import axios from "axios"
function App() {
  const [data,setData]=useState([])
  useEffect(()=>{
    axios.get("https://639c50f416d1763ab1461101.mockapi.io/usedata?limit=10&&page=1")
    .then(((res)=>{
      // console.log(res.data)
      setData(res.data)
    }))
  },[])
  console.log(data)
  return (
    <div className="App">
   {data.map((item) => (
        <div key={item.id} className="product-card">
          <img src={item.image} alt={item.title} className="product-image" style={{width}} />
          <h3 className="product-title">{item.title}</h3>
          <p className="product-price">Price: {item.brand}</p>
          <p className="product-category">Category: {item.category}</p>
          <p className="product-gender">Gender: {item.gender}</p>
        </div>
      ))}

    </div>
  );
}

export default App;
